(3, 3, '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<big><strong>Privacy Policy&nbsp;&nbsp;</strong>&nbsp; &nbsp;&nbsp;</big></p>\r\n\r\n<p><big>&ldquo;Vending MyChine respect the privacy of the users of their mobile applications (&ldquo;User&rdquo; or &ldquo;you&rdquo;) and are<br />\r\ncommitted to protect the User&rsquo;s information. This Privacy Policy explains the types of information we<br />\r\ncollect, and how we collect, use, disclose, share and protect your information. We recognize the<br />\r\nimportance of protecting the information collected about you. Please familiarize yourself with our privacy<br />\r\npractices.</big></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><big>If you have any questions, complaints, or comments regarding our privacy statement or policies, please<br />\r\ncontact us immediately at ? dking@vendingmychine.com? .</big></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><big>BY INSTALLING THE APPS ON YOUR MOBILE DEVICE, ENTERING INTO, CONNECTING TO,<br />\r\nACCESSING AND/OR USING THE APPS, YOU AGREE TO THE TERMS AND CONDITIONS SET<br />\r\nFORTH IN THIS PRIVACY POLICY, INCLUDING TO THE POSSIBLE COLLECTION AND<br />\r\nPROCESSING OF YOUR PERSONAL INFORMATION AND YOU ARE CONSENTING TO THE<br />\r\nUSE OF COOKIES AND OTHER TRACKING TECHNOLOGIES ON YOUR DEVICE. PLEASE<br />\r\nNOTE: IF YOU OR, AS APPLICABLE, YOUR LEGAL GUARDIAN, DISAGREE TO ANY TERM<br />\r\nPROVIDED HEREIN, YOU MAY NOT INSTALL, ACCESS AND/OR USE THE APPS AND YOU<br />\r\nARE REQUESTED TO PROMPTLY ERASE THEM, AND ANY PART THEREOF, FROM YOUR<br />\r\nMOBILE DEVICE.</big></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><big>If you are under the age of thirteen (13) you hereby represent that your legal guardian has reviewed and<br />\r\nagreed to this Privacy Policy.</big></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><big>Information We Collect</big></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><big>We may collect through the Services both personal information that identifies you and can be used to<br />\r\ncontact you, and non-personal information, which is data in a form that does not allow direct association<br />\r\nwith you, which may include technical information, including the IP address through which you are<br />\r\naccessing the Services and the unique mobile device ID or virtual unique device identifier for any mobile<br />\r\ndevice you may be using.</big></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><big>1. Personal Information</big></strong></p>\r\n\r\n<p><big>Personal information may include, but is not limited to, your name, e-mail address, date of birth, and any<br />\r\npersonal photo or image representation. We will collect, use and disclose personal information only as<br />\r\ndescribed in this Privacy Policy. Please note that some non-personal information would be considered a<br />\r\npart of your personal information if it were combined with other information in a way that enables you to&nbsp;be identified, but the same information is considered non-personal information when taken alone or<br />\r\ncombined only with other non-personal information.</big></p>\r\n\r\n<p><strong><big>1. Non-Personal Information</big></strong></p>\r\n\r\n<p><big>Non-personal information, alone, cannot be used to identify or contact you. We collect non-personal<br />\r\ninformation about your use of Vending MyChine and includes aggregated information regarding usage of<br />\r\nthe Apps. The non-personal information collected may include information related to your mobile device<br />\r\nor computer system, including mobile device type, IP address, unique mobile device ID or other device<br />\r\nidentifiers, Media Access Control (MAC) address, telephone number of mobile device, country of<br />\r\nregistration. It may also include browser type, language, Internet Service Provider (ISP), referring and<br />\r\nexit pages, time spent, information searched for, time and date stamp, clickstream data, feature usage,<br />\r\ngame play statistics, scores and achievements, user rankings, time spent playing our games, and other<br />\r\nstatistics.</big></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><big>How We Use Your Information</big></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><big>Generally, we use your information to provide you with an efficient and customized experience. For<br />\r\nexample, we may use information in the following ways:</big></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><big>To send important notices, such as communications about your purchases and changes to this<br />\r\nPrivacy Policy;</big></p>\r\n\r\n<p><big>1.To inform you about new Vending MyChine products and promote Vending MyChine<br />\r\napplication;</big></p>\r\n\r\n<p>2. To send &quot;push&quot; notifications to your mobile device regarding Vending MyChine that you have<br />\r\nbeen using (for example, suggesting that you open the Vending MyChine to take certain<br />\r\nactions);</p>\r\n\r\n<p>3.To provide technical support and respond to inquiries from you;</p>\r\n\r\n<p>4.To prevent fraud and potentially illegal activities;</p>\r\n\r\n<p>5.&nbsp;To help us to develop, deliver and improve the Apps;</p>\r\n\r\n<p>6.For market research purposes that support our efforts to deliver a more valuable service to our<br />\r\ncommunity of Vending MyChine users;</p>\r\n\r\n<p>7.To deliver and target advertising from third parties;</p>\r\n\r\n<p>8.To gather demographic information about Vending MyChine users in order to more effectively<br />\r\nmanage the Apps and provide targeted advertising; and</p>\r\n\r\n<p>9.To track clicks or other ad fulfillment metrics.</p>\r\n\r\n<p>If we send e-mail or SMS messages to you for the purpose of promoting Vending MyChine or services, or<br />\r\nthose of a third-party partner, we will generally provide you with choices about receiving further such<br />\r\npromotional messages. Preferences for &quot;push&quot; notifications may in most cases be adjusted through<br />\r\nVending MyChine or your mobile device.</p>\r\n\r\n<p><strong>Interaction with Game Center or Other 3rd Party Game Services</strong></p>\r\n\r\n<p>y registering with your Game Center on your device (&ldquo;Game Center&rdquo;), you allow Vending MyChine to<br />\r\naccess certain information from your profile for that Game Center. The information you allow us to<br />\r\naccess is affected by the privacy settings you and your friends establish at the Game Center. You can<br />\r\ncontrol and find out more about these settings directly from the Game Center. For example, we may<br />\r\naccess and store some or all of the following information, as allowed by you, the Game Center and your<br />\r\npreferences:<br />\r\n<br />\r\n1.Your first and last name;<br />\r\n2 . Email address ;<br />\r\n3 . The URL of your Game Center profile;<br />\r\n4 . Your user ID number, which is linked to publicly available information such as name and<br />\r\n5 . profile photo<br />\r\n6 . The email and other public data for your friends;<br />\r\n7 . The login e-mail you provided to that Game Center when you registered;<br />\r\n8 . Your gender.<br />\r\n9 . Date of Birth<br />\r\n10 . Password</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>By connecting any Vending Mychine you consent to our access, use and storage in accordance with this<br />\r\nPrivacy Policy of any and all of the information that you agreed the Game Center could provide to<br />\r\nVending MyChine. You may be able to specify what information is provided by the Game Center to us by<br />\r\nusing the privacy settings in your Game Center profile information.<br />\r\n1. Other<br />\r\nWe may offer you the opportunity to provide us with your e-mail address so that we may register you to<br />\r\nreceive premium support or provide you with special offers from Vending MyChine.<br />\r\nVending MyChine may provide you the opportunity to participate in include sweepstakes or contests<br />\r\n(&quot;Promotions&quot;). If you choose to participate in a Promotion, we may request that you provide us with<br />\r\npersonal information such as your e-mail address or mailing address.<br />\r\nIf you request support relating to Vending MyChine product, we may request personal information such<br />\r\nas your name and e-mail address and your user name for any SNS&#39;s, if that appears necessary to resolving<br />\r\nthe problem.<br />\r\nWe may also request or receive personal information in other interactions you may have with IEC Global<br />\r\nPTY LTD.<br />\r\n1. Cookies and Other Technologies<br />\r\nA cookie is a small string of text that we, or service providers acting on our behalf, send to your<br />\r\ncomputer&#39;s or mobile device&#39;s browser. Other types of cookies exist, but the cookies in the Apps are only<br />\r\nused to obtain browser or device-specific information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Some cookies are necessary to enable a game to function properly and to allow your gameplay experience<br />\r\nto continue from one session another. Other cookies can show, for instance, which parts of Vending<br />\r\nMyChine are the most popular, how much time users are spending there, and how they are interacting<br />\r\nwith the content.<br />\r\nYou may have the option to disable cookies by changing the options in your browser to stop accepting<br />\r\ncookies or to prompt you before accepting a cookie from the pages you visit. Additionally, you can<br />\r\ndisable or delete similar data used by browser add-ons, such as Flash cookies, by changing the add-on&#39;s<br />\r\nsettings or visiting the website of its manufacturer.<br />\r\nPlease note that third parties delivering advertisements through the Services may also use cookies or other<br />\r\ntechnologies. Their placement and use of cookies and other technologies will be subject to their own<br />\r\nprivacy policies and terms and conditions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>How We Share Your Information</strong></p>\r\n\r\n<p><strong>1. With Third-Party Advertising Entities</strong></p>\r\n\r\n<p><br />\r\nWe accept advertisements from Third Parties ad networks which may be displayed in our Apps. We may<br />\r\nshare certain information with third-party advertisers, ad networks and ad platforms (&quot;Advertising<br />\r\nEntities&quot;) to develop and deliver targeted advertising in the Apps. We may also allow Advertising Entities<br />\r\nto collect non-personal information within the Services which they may share with us, including your<br />\r\ndevice identifier, device type, device brand, device model, OS type/version, network type, device<br />\r\nlanguage, device locale, and IP address. Advertising Entities may also collect non-personal information<br />\r\nrelated to the performance of the advertisements, such as how many times an advertisement is shown,<br />\r\nhow long an advertisement is viewed, and any click-throughs of an advertisement. Advertising Entities<br />\r\nmay collect this information through the use of tracking technologies like browser cookies and web<br />\r\nbeacons.</p>\r\n\r\n<p><br />\r\n<strong>1. With Other Service Providers</strong></p>\r\n\r\n<p><br />\r\nTo help administer the Apps, we may use third-party service providers. These service providers will have<br />\r\naccess to your information only to perform the services they have been engaged to perform for us, and<br />\r\nthey have agreed not to disclose or use it for any other purpose.</p>\r\n\r\n<p><br />\r\n<strong>1. Under Special Circumstances</strong></p>\r\n\r\n<p><br />\r\nWe may disclose information about you to law enforcement officials or private parties as we, in our sole<br />\r\ndiscretion, believe necessary or appropriate to respond to claims and legal process (including but not<br />\r\nlimited to subpoenas), to protect the property and rights of Vending MyChine or a third party, to protect<br />\r\nthe safety of any person or to prevent or stop activity we may consider to be illegal or unethical.</p>\r\n\r\n<p>In connection with a merger, acquisition, reorganization or sale of assets, or in the event of bankruptcy,<br />\r\nwe may sell, transfer or otherwise share some or all of Vending MyChine assets, including your personal<br />\r\ninformation.<br />\r\nLinks to Third-Party Websites and Services<br />\r\nThe Apps may contain links to other websites and online services, including third-party advertisements. If<br />\r\nyou choose to click through to one of these other websites or online services, please note that any<br />\r\ninformation you may provide will be subject to the privacy policy and other terms and conditions of that<br />\r\nwebsites or service, and not to this Privacy Policy. We do not control third-party websites or services, and<br />\r\nthe fact that a link to such a website or service appears in the Apps does not mean that we endorse them or<br />\r\nhave approved their policies or practices relating to user information.<br />\r\nBefore providing any information to any third-party website or service, we encourage you to review the<br />\r\nprivacy policy and other terms and conditions of that website or service. You agree that Vending<br />\r\nMyChine will have no liability for any matters relating to a third-party website or service that you provide<br />\r\ninformation to, including their collection and handling of that information.<br />\r\nNon-US Users<br />\r\nInformation that you provide may be transferred or accessed by entities around the world as described in<br />\r\nthis Privacy Policy. If you are located outside the United States, you understand that we may transfer<br />\r\npersonal information to and process it in the United States. If you are located in the European Union, you<br />\r\nfreely consent to the transfer of personal information outside of the European Union. Your consent to this<br />\r\nPrivacy Policy followed by your submission of personal information represents your agreement to these<br />\r\ntransfers.<br />\r\nYour California Privacy Rights<br />\r\nIf you are a California resident and Vending MyChine&rsquo; user, you are entitled to request certain<br />\r\ninformation regarding our disclosure of certain &quot;personal information&quot; (as defined in California Civil<br />\r\nCode Section 1798.83) to third parties for their direct marketing purposes. If you are a California resident<br />\r\nand have provided us with personal information within the last year, you may make such a request by<br />\r\nemailing us at dking@vendingmychine.com? and typing the following in the subject line of the e-mail:<br />\r\n&quot;California Privacy Rights&quot;.<br />\r\nWithin 30 days of receiving such a request, we will provide a list of the categories of personal information<br />\r\ndisclosed to third parties for such third parties&#39; direct marketing purposes during the immediately<br />\r\npreceding calendar year, along with the names and addresses of these third parties. A request may be<br />\r\nmade no more than once per calendar year and we are not required to respond to requests made by means<br />\r\nother than through the e-mail address above.</p>\r\n\r\n<p><strong>Contact us with any questions:</strong></p>\r\n\r\n<p>Email:&nbsp;<strong>dking@vendingmychine.com</strong></p>\r\n', '', '', 0, '0000-00-00 00:00:00', '2019-12-09 16:30:50');
